<Box className="body">
                <Card sx={{

                    width:'100%',
                    height:150,
                    display:'flex',
                    flexDirection:'row',
                    justifyContent:'flex-start',
                    alignItems:'flex-start'
                }}>
                        <Box  sx={{width:'60%',
                    height:'100%',

                    display:'flex',
                    flexDirection:'column',alignItems:"flex-start"
                    }}>

                            <CardContent sx={{width:'100%',height:'100%',display:'flex',
                                            justifyContent:'flex-start',}}> 
                                            <Box sx={{
                                                width:'20%',
                                                height:'80%',

                                            }}>
                                                <img src={image} style={{width:'100%'}}/>
                                            </Box>
                                            <Box sx={{
                                                width:'50%',
                                                height:'100%',

                                                display:'flex',
